import {Router, Link, NavLink} from 'react-router-dom';

const Contact = () => {
return (
	<nav className="nav-wrapper red darken-3">
		<div className="container">
			<Link className="brand-logo" to="./">Blog</Link>
			<ul className="right">
				<li>Home</li>
				<li>About</li>
				<li>Contact</li>
			</ul>
		</div>
	</nav>
	);
}

export default Contact;
